const Button = (props) => {
    return <button onClick={props.handler}>{props.name}</button>
}

const Header = (props) => {
    return <h1>{props.name}</h1>
}

const Statistic = (props) => {
    return (
        <table>
            <tbody>
                {props.stats.map((line) => <StatisticLine key={line[0]} first={line[1]} second={line[2]} />)}
            </tbody>
        </table>
    )
}

const StatisticLine = (props) => {
    return (
        <tr>
            <th>{props.first}</th>
            <th>{props.second}</th>
        </tr>
    )
}

export { Header, Button, Statistic }
